window.bookSummaryJSON = "<p><b>A wounded fae prince. A determined human healer. A love destined to temper a curse.</b></p> <p>Holly only wants to heal her sick mother and live a simple village life, not be whisked away to a strange realm and possibly get killed by a dangerous fae warrior. But sometimes fate has other plans.</p> <p>Far from home, his horse and eagle missing, Gadriel, the cursed heir to the Throne of Five, captures a human girl, mistaking her for the evil sorceress foretold to bring about the fall of his beloved kingdom.</p> <p>Wounded while fighting the sacred boar, instead of killing the little witch, he demands she heal him, planning to dispose of her when he recovers. But little does he know he's captured his fated mate—the answer to all his problems—and holds her at his mercy in an isolated cottage in the woods.</p> <p>After Holly discovers Gadriel's true identity and his arrogance turns into something more dangerous, she'll need every ounce of willpower not to fall for his flirtations and return home in time to save her mother. <i>If</i> the ruthless fae prince will let her go.</p> <p><b>This full-length prequel can be listened to any time. The events happen long before Book 1, </b><b><i>Prince of Never</i></b><b>.</b></p> <p>Contains mature themes.</p>"; 
